import React from 'react';
import logo from '../../../images/logo.png';
import '../../../style/style.css';

const CustomizedLogo = () => {
    return(
        <div className='imagecontainer'>
            <img src={logo} />
        </div>
    );
}
export default CustomizedLogo;
